import { GoogleMap , Marker} from 'react-google-maps';
import mapMarkers from './markers';

export function defaultMap(){
    return(
        <GoogleMap defaultZoom = {12} 
        defaultCenter = {{lat : 46.770920 , lng : 23.589920}}>
            {mapMarkers.map((currentMarker) => {
                return (
                    <Marker key = {currentMarker.key} position = {currentMarker.position} icon = {{url : "/images/P.png" , scaledSize : new window.google.maps.Size(50 , 50)}}/> 
                )
            })}
        </GoogleMap>
    );
}

function userMap(userLat , userLong){
    return(
        <GoogleMap defaultZoom = {12} 
        defaultCenter = {{lat : 46.770920 , lng : 23.589920}}>
            {mapMarkers.map((currentMarker) => {
                return (
                    <Marker key = {currentMarker.key} position = {currentMarker.position} icon = {{url : "/images/P.png" , scaledSize : new window.google.maps.Size(50 , 50)}}/> 
                )
            })}
            <Marker key = {mapMarkers.length + 1} position = {{lat : userLat , userLong}} icon = {{url : "/images/P.png" , scaledSize : new window.google.maps.Size(50 , 50)}}/>
        </GoogleMap>
    );
}

export default userMap;
